import './navItem.css'



const navItem = () => {
  return (
<li className='nav-item'>
    {props.children}
</li>
  )
}




const navItemDropDown = () => {
    return (
  <li className='dropdown-item'>
      {props.children}
  </li>
    )
  }

export default navItem
export {navItemDropDown}
